import React, { useState, useEffect } from "react";
import {BrowserRouter, Routes, Route} from "react-router-dom";
import ChatScreen from "./component/ChatScreen/ChatScreen";
import FileUpload from "./views/fileupload";
import CamScreen from "./component/CamScreen/CamScreen";
import Home from "./views/home";

const App = () => {
  return (
<>
<BrowserRouter>
  <Routes>
    <Route path="/" element={<Home/>} />
    <Route path="/homepro" exact element={<Homepro/>}/>
    <Route path="/streaming" exact element={<Streaming/>}/>
    <Route path="/fileupload" exact element={<Fileupload/>}/>
  </Routes>
</BrowserRouter>
</>
  );
};


export default App;
